/* eslint-disable */

import React from 'react';

const DefaultDashboardBody = () => {
  const is_create_experiment_modal_active = false;
  return (
    <div>
      <h6>Experiments</h6>
      <button
        className="button is-info rs-m-1"
        onClick={() => {is_create_experiment_modal_active = true}}>
        {'...Create Experiment'}
      </button>
      <table className="table rs-shadow-1 rs-border-radius-sm rs-border is-hoverable is-fullwidth">
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Active</th>
            <th>Created</th>
            <th>Last Modified</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Test colord buttons</td>
            <td>Color button should make people happy</td>
            <td>False</td>
            <td>01/20/2021</td>
            <td>01/20/2021</td>
            <td>
              <span class="icon">
                <i class="fas fa-ellipsis-v"></i>
              </span>
            </td>
          </tr>
          <tr>
            <td>Test colord radio input</td>
            <td>Radio input should make people buy more stuff</td>
            <td>False</td>
            <td>01/20/2021</td>
            <td>01/20/2021</td>
            <td>
              <span class="icon">
                <i class="fas fa-ellipsis-v"></i>
              </span>
            </td>
          </tr>
        </tbody>
      </table>

      {/* Modals */}
      <CreateExperimentModal is_active={is_active}/>
    </div>
  );
};

const CreateExperimentModal = ({ is_active }) => {
  is_active = false;
  return (
    <div className={`modal ${is_active ? 'is_active': ''}`}>
      <div className="modal-background"></div>
      <div className="modal-content">
        {/* <!-- Any other Bulma elements you want --> */}
      </div>
      <button
        className="modal-close is-large"
        aria-label="close"
        onClick={() => {
          is_active = false;
        }}
      >
      </button>
    </div>
  );
}

export default DefaultDashboardBody;
